/* new window size or exposure */
static void reshape(int width, int height) {
	glViewport(0, 0, (GLint) width, (GLint) height);
}

/* Called once */
static void init() {
	// Init stuff before the grabbed frames here
	glClearColor(0.4, 0.4, 0.4, 0.0);

	// Initialize timing
	gametime::init();

	// Just do the grabbed frames
	simulate();
}

int main(int argc, char *argv[]) {
	char *dpyName = NULL;
	GLboolean printInfo = GL_FALSE;
	int i, retval;
	const char *s;

	for (i = 1; i < argc; i++) {
		if (strcmp(argv[i], "-display") == 0) {
		 dpyName = argv[i+1];
		 i++;
		}
		else if (strcmp(argv[i], "-info") == 0) {
		 printInfo = GL_TRUE;
		}
		else {
		 usage();
		 return -1;
		}
	}

	/* TODO: handle keyevents or idle or remove/disable reshape */
	retval = gles2run(init, drawUpdate, reshape, NULL, NULL, "GLES2-helper test code for rtw r300 glitch testing", 640, 480, GL_TRUE, NULL);

	return retval;
}

